    value: This amendment is being filed in response to the FECs letter dated May
      8, 2008.  According to the letter, it is your deisre to obtain a plan for reimbursing
      general election contributors.  According to the FEC regulations, general election
      contributions are to be reimbursed 60 days after the candidate announces he/she
      will not participate in the general election.  The Ron Lewis for Congress committee
      refunded every general election contribution, excluding a $500 contribution
      from Strategic Healthcare, less than 30 days after the candidate announced he
      would not participate in the general election.  The failure to issue a reimbursement
      to Strategic Healthcare was a clerical oversight and was corrected on May 12,
      2008.  This report better reflects the general election refunds by noting they
      are general election refunds rather than simply describing them as contribution
      refunds.
